import React from 'react';
import formatDate from '../helpers/formatDate';

const Comment = ({ comment }) => {
  return(
    <article>
      <div>
        <span>{ comment.user }</span> el { formatDate(comment.date) }
      </div>
      <p>{ comment.comment }</p>

    </article>
  )
}

export default Comment;
